import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;
  font-family: "Roboto";
  width: 100%;
  padding: 15px;
`;

const Header = styled.h2`
  display: flex;
  font-weight: 900;
  font-size: 2em;
  text-align: center;
`;

const SubHeader = styled.h3`
  color: red;
  font-size: 1.5em;
  text-align: center;
  font-family: "Black Ops One", cursive;
  margin: 10px 0;
`;

const GameTypes = () => {
  return (
    <Wrapper>
      <Header>Welcome in our shop</Header>
      <SubHeader>Online Gaming</SubHeader>
    </Wrapper>
  );
};

export default GameTypes;
